import React from 'react';
import Fixture from './Fixture';
import styled from "styled-components";

const Fixtures = (props) => {

    function returnFixtureFromPicks() {
        const fixtureHasPick = props.listOfPicks.filter(i => {
            i.substring(0, j.indexOf(":")) === props.data.results
        })
    }

    let filteredDuplicatePicks = listOfPicks.filter((j) => {
        let idTeamFromState = j.substring(0, j.indexOf(":"));
        return idTeamFromState !== idTeamFromPick;
    });


    function createFixtures() {
        let arr = [];
        props.data.results.forEach((i) => {
            const findFixturePick = props.listOfPicks.filter(i => {
                i.substring(0, j.indexOf(":")) === i.id
            });
            console.log(findFixturePick);
            if(i.game_week === props.currentRound && i.game_week === props.currentRoundImmutable) {
                arr.push(<Fixture listOfPicks={props.listOfPicks} key={i.id} fixture={i} addPick={props.addPick} currentRound={true} />)
            } else if (i.game_week === props.currentRound) {
                arr.push(<Fixture listOfPicks={props.listOfPicks} key={i.id} fixture={i} addPick={props.addPick} currentRound={false} />)
            }
        })
        return arr;
    }

    return (
        <FixturesStyle>
            {createFixtures()}
        </FixturesStyle>
    )
}

